import SvgIcon from '@material-ui/icons/Print';
import {ReactComponent as Skull} from './skull.svg';
import {ReactComponent as Bat} from './bat.svg';
import {ReactComponent as Pumpkin} from './pumpkin.svg';
import {Folder} from '@material-ui/icons';
const GetIcon :any= {
    'Skull' : Skull,
    'Bat' : Bat,
    'Pumpkin': Pumpkin,
    'Home':Folder,
    'Themes':Folder,
    'Projects':Folder,
  }
const Icon = ({icon, onclick, fontSize, color}: {icon?:string, onclick?:(e:any)=>void; fontSize?: number, color?: string}) => {
const myIcon = GetIcon[icon as string];
if (!myIcon) return <div></div>;
    return (
        <SvgIcon
        onClick={(e: any) => {
            return onclick ? onclick(e) : null;
        }}
        style={{
            fontSize: fontSize === undefined ? 30 : fontSize,
            color: color === undefined ? '' : color,
        }}
        component={myIcon}
        ></SvgIcon>
    );
};
export default Icon;
